import React, { Component } from 'react'
import Layout from '../../Components/Layout'

class newCandidate extends Component{
    render(){
        return(
            <Layout>
                <link></link>
                <h3>Here we create Candidates</h3>
            </Layout>
        )
    }
}

export default newCandidate
